import React, { Component, Fragment } from 'react';
import { Link } from 'react-router-dom'


class Nav extends Component {

    state = {
        count: 20
    };

    render = () => {
        const { count } = this.state;
        return (
            <Fragment>
                <nav>
                    <ul>
                        <li></li>
                    </ul>
                </nav>
            </Fragment>
        )
    }
}

export default Nav;
